import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import PieChart from 'variables/PieChart';


const PieChart1 = ({DefectState, ProductionLineState}) => {

if(ProductionLineState=="All"){

return(

        <div className='PieChart'>

        <div className='PieChart-header'>
            <FaIcons.FaChartPie className='PieChart-icon' size={20} color={'white'}/>
            <h3 className='PieChart-title'>Pie Chart</h3>

        </div>

        <div className='PieChart-body'>
            <div className='infocard'>

                <PieChart />
                <h5 className='card-title'>All Defects</h5>

             </div>



        </div>


        </div>









)

}
else{
    return
}
}




export default PieChart1;
